INSERT INTO `impression` (`id`, `doujinshi_id`, `user_id`, `body`, `create_time`, `update_time`, `delete_time`)
VALUES
	(1,2190,2,'一人称視点の文章が心地よかった。\r\n驚いた時の表現を「えっこのひとすごいとなる。」って描写するの古明地こいしっぽくて凄い良かった。','2015-11-17 14:23:40','2015-11-17 14:24:11',NULL),
	(2,1414,2,'完成度の高さに吐きそうになった。\r\n八雲紫と博麗霊夢がくっついたあたりで「あっこれ上げて落とすやつだ！」と気づいた。\r\n\r\n千年生きれば生きただけ背負う他人とのつながりが増えていく。全然別の話だけど仙人みたいな伝承上の不老不死の存在が判を押したように隠居みたいな生活してるのは、そりゃ普通に他人と接触してると他人に対する責任が無限に膨らんでいくからだろうなって思った。\r\n\r\n八雲紫の半生を紐解いていく作品で、儚月抄もそうだったけど、割りと得体のしれない行動原理の八雲紫の事を知れた気分になって良かった。','2015-11-17 19:17:33','2015-11-18 21:28:58',NULL),
	(3,1711,2,'霊夢視点と魔理沙視点の2冊に分ける手法は本当に最高だと思った。\r\n魔理沙サイドから読むのが良い。','2015-11-17 19:20:10','2015-11-17 19:20:10',NULL),
	(4,1,2,'世界観と文章の雰囲気を楽しむものとして読んだ。\r\nあまり本質的な事を書こうとはしてないんだろな〜って思ってたけど、\r\nもしひとつひとつのワードに本質的な意味を込めてるのならびっくりする。','2015-11-17 19:21:19','2015-11-17 19:21:28',NULL),
	(5,319,2,'起承転結あってよかった','2015-11-17 19:22:19','2015-11-17 19:22:19',NULL),
	(6,1002,2,'ゆかれいむ。東方における妖怪の存在意義の設定って便利だなと思った。','2015-11-17 19:23:03','2015-11-17 19:23:03',NULL),
	(7,2176,2,'ふわふわした。','2015-11-17 19:23:33','2015-11-17 19:23:33',NULL),
	(8,1315,2,'初見読めばおどろおどろしい復讐劇。\r\n最後の文でつじつまが合わなくなって、\r\n2回目読めば大学生の恋愛沙汰の痴話喧嘩。\r\n作中起こりうる出来事だけで充分生々しいですが、\r\n文章も生々しく表現されてて、作品内に没入できました。','2015-11-17 19:26:49','2015-11-17 19:26:49',NULL),
	(9,2141,2,'幻想郷において人間は妖怪たちの家畜に過ぎないかという命題、\r\n突き詰めれば面白そう。','2015-11-17 19:27:39','2015-11-17 19:27:39',NULL),
	(10,1706,2,'弁舌とリボン、幻想郷のエコシステムに触れた話は相変わらず好き。\r\n幻想郷に妖怪そのものが流れ着いた時代から、\r\n現代から姿を消した概念が妖怪に形を変えて\r\n幻想郷に流れ着く時代にパラダイムシフトした時期があったのでは。','2015-11-17 19:29:11','2015-11-17 19:29:27',NULL),
	(11,1159,2,'幻想郷崩壊、時間ループ、離別した登場人物を請う、と好きな設定たくさん。\r\n加えて咲夜とレミリアの出会いの話は良かった。ハッピーエンド。','2015-11-17 19:30:50','2015-11-17 19:30:50',NULL),
	(12,2191,2,'SFディストピアだいしゅき。\r\n宇佐見蓮子が故人なのは設定として個人的に新しく好きだった。','2015-11-17 19:32:42','2015-11-17 19:32:42',NULL),
	(13,257,2,'東方プロジェクトと秘封倶楽部を知ってすぐ読んだ本。\r\n当時すごく心にきた印象がある。\r\n今、また読み返したい','2015-11-17 19:36:40','2015-11-17 19:36:40',NULL),
	(14,175,2,'幽々子の過去話。','2015-11-17 19:37:42','2015-11-17 19:37:42',NULL),
	(15,2084,2,'さくさく読めた','2015-11-17 19:39:30','2015-11-17 19:39:30',NULL),
	(16,2192,2,'紅魔館とレミリアとフラン。フランが主観の話。','2015-11-17 19:43:22','2015-11-17 19:43:22',NULL),
	(17,1331,2,'八雲紫の式になる前の八雲藍の話。歴史もの。','2015-11-17 19:44:19','2015-11-17 19:44:19',NULL),
	(18,1517,2,'妖々夢の過去話。八雲紫の出生の設定が良かった。','2015-11-17 19:46:13','2015-11-17 19:46:13',NULL),
	(19,1050,2,'阿求と霊夢と早苗の話。巫女の舞。日常系の話。','2015-11-17 19:46:57','2015-11-17 19:46:57',NULL),
	(20,1555,1,'ロマンチックメロウさんところの秘封二人の会話は非常に茶番ぽくてニヤニヤしてしまう。\r\n蓮子とメリーの日常系の小説は、二人の会話の小気味よさを楽しむものだなと。\r\n','2015-11-18 21:16:29','2015-11-18 21:16:29',NULL),
	(21,1555,2,'ロマンチックメロウさんところの秘封二人の会話は非常に茶番ぽくてニヤニヤしてしまう。\r\n蓮子とメリーの日常系の小説は、二人の会話の小気味よさを楽しむものだなと。','2015-11-18 21:17:21','2015-11-18 21:17:21',NULL),
	(22,470,2,'蓮メリとゆかれいむ。蓮メリの会話の小気味の良さと、霊夢と紫の会話の小気味の良さが良かった。','2015-11-18 21:18:24','2015-11-18 21:18:24',NULL),
	(23,1436,2,'「ねぇメリー、提案があるのだけれど」と会話に一テンポを置く秘封特有の会話大好き。\r\n\r\n好きなやり取り①\r\n「ねぇメリー、提案があるのだけれど」「蓮子の言うことなら善処するわ」「そろそろ建物の中で話さない？」「却下」「ああっ優しかった頃のメリーはどこにいったのかしら。きっとここにいるメリーはエイリアンね」\r\n\r\n好きなセリフ①\r\n「うら若き乙女の肌を見るとは、メリーさんもなかなかやり手なのね」','2015-11-18 21:20:23','2015-11-18 21:20:23',NULL),
	(24,2193,2,'現代入りした幻想郷キャラのセックスを通したあんまり幸せじゃないタイプのセックスをする話\r\n\r\n霊烏路空が春を売る話。セックス対象として求められる事しか自分のアイデンティティがない女の子。彼氏が好きな理由が自分を愛してくれるからって理由しかない女の子。こういう依存心が強くて頭の弱い子と霊烏路空ってキャラクターは相性いいなと思った。\r\n\r\n堕胎手術系の話というと、誰ともわからぬ子の生命を宿した嫌悪感とか、一人で病院に行く時の不安感とか、幸せの象徴である妊娠とのギャップが良かったりするんだけれど、堕胎手術に際してそういう事が考えられるのは割と頭のいい子特有のものなのだなあと思った。\r\n\r\n堕胎手術の手続きの帰りに、幸せそうな親と子を見かける描写があるのは良かった','2015-11-18 21:23:46','2015-11-18 21:23:46',NULL),
	(25,2194,2,'大学を卒業した宇佐見蓮子の就職活動がうまく行かないお話。毒親ライクな両親の存在に蓮子が徐々に追い詰められていく描写が良かった。\r\n\r\n面接に対して「下手な鉄砲数打ちゃ当たる」、志望動機に「自立したい」と語る様子が、いわゆるダメなタイプの就職活動方法をしていたのが心苦しいとともに、やっぱりそういう価値観で職を探してる人がいるんだなぁと新鮮な気持ちになった。\r\n\r\n就職のために資格を取る。宅建を取るために予備校に通う。勉強はできるので予備校では成績優秀、しかし本番では何故か結果が出せない。真面目で与えられた事は実直にこなすが、主体性や向上心が感じられない。社会に出るのに苦労する性格が良く描写されている。\r\n\r\n蓮子の夢の中に八雲紫が出てくる描写、日常にうんざりする人間が非日常の世界に逃げようとする様はBADENDパターンの定番だけれど、だからこそ物語の救いの無さを強調してくれてよかった。','2015-11-18 21:25:07','2015-11-18 21:25:07',NULL),
	(26,2195,2,'古明地さとりと火焔猫燐が姿を消したこいしを探しに行くお話。エログロが多い。ところどころに挟まれる生々しい描写が好み。\r\n\r\n「あまり頭の出来がよくない」と自分を弁えるお燐が、「頭の出来が良い」上位者に振り回されつつも、主従の一線を超えて古明地さとりを想うのは良かった。さとりが口をつけた吸い飲みで自慰をするお燐はポルノというよりそうした想いの描写として大変良かった。\r\n\r\n「母親の痴態を初めて目の当たりにした男の子のようだった」って表現が好きすぎる','2015-11-18 21:28:04','2015-11-18 21:28:04',NULL),
	(27,2052,2,'物事がマズい方向に向かってても内向的に自分一人で悩んで、しかも悩んでる内容がひどく感情的で論理的な判断に繋がってないの、自分みたいでひどく同族嫌悪みたいな感情を覚えた。\r\n\r\n身の周りに起きた事象を否定するその矮小さも良かったですね。そして否定しちゃったせいで問題が発生するとすぐ右往左往するところも小物っぽくて良かった。\r\n\r\nというかこのシリーズの感想。主人公が皆無能というかそこに考えが及ばないのか……って思いながら読み進めてた。','2015-11-18 21:30:07','2015-11-18 21:30:07',NULL),
	(28,2197,2,'東方創想話で初めて読んだ作品。\r\n八雲紫の生い立ち的な話。\r\n賢者かつあの胡散臭い立ち振舞いがどう出来上がったのか、当時すごく興味を\r\n持ってて、色々その手の創作小説を読んでいた記憶がある。','2015-11-25 00:21:40','2015-11-25 00:21:40',NULL),
	(29,1582,49,'椛と文、はたての3天狗を中心とした妖怪の山で起きた誘拐事件のストーリーだが、なんとオリキャラの天狗が6人も登場し、上記に加えにとりの4人しか既存のキャラが登場しない。また、絵は良いのだが文章が粗だらけで「案山子念報」と表記されていたり、展開がおかしい部分も多い。一応文章はweb版で直されているが…http://t.co/bowbWrjUIK  パスは「inubashiri」','2015-11-25 23:20:02','2015-11-25 23:20:02',NULL),
	(30,2186,24,'同人音楽サークル【凋叶棕】様の楽曲を題材とした小説の合同誌。\r\n五編の作品はどれも凋叶棕の楽曲を知っていれば「おお！」と思う物ばかりで大変楽しく読むことが出来ました。\r\nタイトルが『幻想浪漫綺行』にかかっている点も非常に憎い。\r\n\r\n簡単ではありますが、それぞれの感想を。ネタバレは無しな方向で。\r\n\r\n『三度目のマッドパーティー』はーしぇん　様\r\n♪マッドパーティー\r\n・凋叶棕の曲を知っている人なら読んでいる途中で「ん？」となって、最後にポンと膝を打つこと請け合い。\r\nあと、３３ページｗｗｗ\r\n\r\n『ビリーブ・ガールズ』満足ひろｐｏｎ　様\r\n♪神風「ブレイブ・ガール」\r\n・原曲のもつ早苗の強さ、不安、覚悟。そう言ったものが爽やかに描き出されていて、とても素敵でした。\r\nちなみに私はこの原曲大好きです。\r\n\r\n『幻想の旅人』桶住人のｍｉｓｔ　様\r\n♪ロストドリーム・ジェネレーションズ\r\n・〝彼女〟は〝だれ〟か？\r\nという問いに答えはあるのか、ないのか。\r\nはたまた、読者に答えは委ねられたのか。\r\n何度も読み返してしまう作品でありました。\r\n\r\n『Ａ　ｇｉｒｌ　ｈａｓ　ｎｉｎｅ　ｌｉｖｅｓ』卯月秋千　様\r\n♪ｆｒｏｍ　ｔｈｅ　ｃｏｒｐｓｅ　ｔｏ　ｔｈｅ　ｊｏｕｒｎｅｙ\r\n・彼女は最後の一瞬まで彼女でしたね。そして、お燐はなんだかんだ面倒見がいい良い娘ですよね。\r\n\r\n『標』みずなみ　様\r\n♪伝説のユグドラシル\r\n・インスト曲からの作品は珍しいなと思いましたが、『うつろわざるもの』ともまた一味違う広い世界観を見ることが出来ました。\r\n\r\nこの本で私が一番感動したのは、あとがきでした。\r\n\r\n〝凋叶棕は『物語音楽サークル』である〟\r\nという一文には非常に共感を得ました。\r\nはーしぇんさんという方は本当によく凋叶棕を聴き、読み、観て、感じて、愛していらっしゃるのだという事がひしひしと伝わってくるものでした。\r\n私も、凋叶棕さんのファンの一人として、感銘を受けると同時に、正直に申し上げれば少しの嫉妬も覚えたほどです。\r\n\r\n凋叶棕ファンの方にはぜひ読んでいただきたい一冊です。\r\n\r\n','2015-11-26 00:01:05','2015-11-26 00:01:05',NULL),
	(31,1291,2,'アリスが主人公。日常の話。WIn東方初期三部作らへんの、幻想郷におけるそれぞれのキャラクターとアリスの絡みを書きたいという筆者の気持ちが伝わってくる。','2015-11-27 01:15:46','2015-11-27 01:15:46',NULL),
	(32,2203,23,'こいしちゃんはいない合同(直接的にこいしが出てくる描写はないがこいしがいるかもしれない作品合同)の作品。\r\n解答編として揺蕩う妹は何を見ていたか があります\r\nナズーリンの感情の表現が上手い上文章を読むだけで風景が浮かぶようで繰り返し楽しんで読めました\r\n\r\nこいしを少し頑張って探してから続きを読むとより楽しく読めると思うので少しじっくり読むことをおすすめします','2015-11-27 17:39:09','2015-11-27 17:39:09',NULL),
	(33,2058,2,'八雲紫と母親になった博麗霊夢。スキマから現れて霊夢にちょっかいかける八雲紫って話にハズレなし。子を産み育てる人の習性を理解できない妖怪。どろりとした粘性のある感情って言葉好き。オチというか霊夢の伴侶が死んだ真相は好みの部類の話だった。','2015-11-28 14:29:52','2015-11-28 14:29:52',NULL),
	(34,2204,2,'紅楼夢11で頒布された「embryo」という同人誌があるのですが、\r\nそれの後日譚を別の方が小説で書かれました(三次創作？)\r\n\r\n元のembryoの方は「魔理沙ちゃんかわいそう（；；）」って感じでしたが、\r\nこちらは「魔理沙ちゃん……」って感じでした。\r\n\r\n妖怪(or 種族：魔法使い)になった霧雨魔理沙を博麗霊夢が滅する二次創作は好きなので、\r\n今後も増えていって欲しい。','2015-11-29 18:37:35','2015-11-29 18:37:35',NULL),
	(35,2205,68,'A5サイズ231ページなので読み応えは抜群、最後は少し泣いてしまいました。\r\nキャラの性格が丁寧につけられていて、そこからの会話の掛け合いなどがとても読みやすいです。\r\n考察されてる部分も多くあり、読みなおしでその部分について考えるのも楽しいです。\r\n\r\nやっぱり霊夢は幻想郷から愛されているのだなと思う一冊でした。','2015-11-30 14:16:38','2015-11-30 14:16:38',NULL),
	(36,2153,94,'拗ねちゃう咲夜さんが可愛かったです　','2015-11-30 19:18:53','2015-11-30 19:18:53',NULL),
	(37,1159,95,'この本の魅力は作品に出てくるキャラの過去や設定が深く掘り下げておりそのキャラごとにエピソードがある事と挿絵と漫画がまた良くて、シリアスだけど鬱にはならない、感動が残る小説です','2015-11-30 19:49:47','2015-11-30 19:49:47',NULL),
	(38,257,95,'絵は秘封倶楽部なんだけど魔理沙が活躍してて、魔理沙が好きな人にもオススメしたい小説です','2015-11-30 19:52:53','2015-11-30 19:52:53',NULL),
	(39,2207,101,'連綿と続く八雲。ジーンとくる。','2015-11-30 22:03:47','2015-11-30 22:03:47',NULL),
	(40,2208,2,'【エロ注意】\r\n東方紅楼夢11で購入。韓国人の方が書かれた西行寺幽々子の凌辱本。\r\n誤字脱字の多い日本語、稚拙な表現が多いが、西行寺幽々子に対する嗜虐心が伝わってくる。\r\n前半が凌辱パートで、後半から突然葉鍵でよくある感じのデート⇛結婚のイチャラブ展開が始まる。','2015-11-30 23:30:28','2015-11-30 23:30:28',NULL),
	(41,2212,2,'お燐とこいしちゃんがあちこち行く話。コメディ。','2015-12-02 01:33:20','2015-12-02 01:33:20',NULL),
	(42,1104,2,'幻想郷の住人が全員博麗の巫女になる異変。日常系のコメディチックな内容。しくしくって泣き真似をするタイプの八雲紫。オチは霊夢にちゅーをねだる八雲紫というゆかれいむでした。良かった。','2015-12-05 15:07:34','2015-12-05 15:07:34',NULL),
	(43,2213,24,'フランドールと霖之助のカップリングで『30日CPチャレンジ』(30日間分、お題に沿って自分の推しCPで作品を作るチャレンジ)に沿って書かれたお話。\r\nフランの霖之助に対する愛情の態度の数々が非常に愛くるしく、またそれを戸惑いながらも真摯に受け止める霖之助の姿も非常に好感が持てる。\r\n終始、にやにやしながら読み進められてとても楽しめる作品でした。\r\n可愛いフランドールが好きな方にはお薦めです。\r\nただ、私は『30日CPチャレンジ』というものを知らずに読んだため、いきなりお題に沿った展開になった部分で少し状況が掴めず混乱した部分がありました。\r\n『30日CPチャレンジ』についての説明が多少なりともあったなら親切だったかもしれません。','2015-12-05 23:16:15','2015-12-05 23:16:15',NULL),
	(44,1028,2,'自分の発明を通じたにとりと幻想郷の人々を書いた話。\r\n「便利と感じるのは人によって違う。何が役に立つかもヒトそれぞれってことさ」\r\nというのは私もエンジニアなので深く理解できますね。\r\n\r\n紅魔館は爆発しませんが紅美鈴は爆発します。','2015-12-06 15:51:46','2015-12-06 15:51:46',NULL),
	(45,2118,139,'射命丸文と阿夢から始まる御阿礼の子とのお話。\r\n感情描写がしっかりしていて、話の流れ自体は読みやすいのについつい涙を流してしまいました。\r\n本編最後の一文からの余韻が最高の一冊です。','2015-12-06 22:59:08','2015-12-06 22:59:08',NULL),
	(46,2228,2,'地霊殿メンバーの日常をえがいた作品','2015-12-12 21:25:36','2015-12-12 21:25:36',NULL),
	(47,2215,24,'お酒にまつわる四つのお話。\r\n阿求が三つ。蓮子が一つ。\r\nお話に出てくるお酒のレシピがそれぞれついているところも物語のイメージを深く感じ取ることが出来るのでとても良かったです。\r\n個人的に特筆したいのが三編目の『壺中の香梅』。\r\nネタバレになるので詳しくは書きませんが、阿求が“次の自分”に対して決してマイナスではない感情で楽観的(こう書くと語弊があるとは思いますが)に楽しみを託していく。という発想が自分にはなかったので阿求の一面としてこういう捉え方もできるのだと大変興味深く読むことが出来ました。\r\n\r\n\r\n','2015-12-13 22:38:07','2016-01-01 01:10:50',NULL),
	(48,2230,2,'生まれ落ちる前の母親の中で胎児として存在する古明地こいしのお話。\r\n「心を読む」「意識と無意識」について語るタイプの小説好きです。\r\n\r\nロリータ服は「子供へのあこがれ」「大人へのあこがれ」に関する\r\nこいしのセリフ好きですね。定期的に読み返したい。','2015-12-31 01:23:05','2015-12-31 01:23:05',NULL),
	(49,2231,2,'秘封倶楽部と幻想郷、「妖怪は恐れられることで存在を保てる」設定系の作品。\r\n幻想郷の住人が自身の存在を保つ目的で外の世界に出てくる話にハズレはないですね。','2015-12-31 13:53:54','2015-12-31 13:53:54',NULL),
	(50,2232,2,'女子大生の宇佐見菫子が就活スーツを身にまとう。超能力は失われ平凡な人間に戻った日々。突然未来に飛ばされ、岡崎夢美と北白川ちゆりと出会う。青年期の人間はとにかく人と自分を比較する。優越感と劣等感をコントロールしながら生きる。幼児的万能感は奪われ、自分が平凡な人間であることを自覚する。','2015-12-31 18:02:54','2015-12-31 18:02:54',NULL),
	(51,2109,2,'アリス・マーガトロイドの死。アリスを知るものたちが葬式の場で語る、アリスの死の真相。','2015-12-31 18:30:28','2015-12-31 18:30:28',NULL),
	(52,2233,2,'元の「幻想で逢いたい」はメリーの蓮子に対する執着が繊細に描写されていた。\r\nメリーにとって大切な人である蓮子、歴史を積み重ねるにつれて幻想郷やその住人も\r\n蓮子と同じように大切な人となっていく。数世紀を経て蓮子への想いに区切りをつけることができたメリー。\r\n\r\n比較して、文字のテンポと描写をボカすことがこの作家の書き味なんだなと最近思う。\r\n決定的な事実を文字でつきつけず、読者の想像に任せる。','2015-12-31 19:32:50','2015-12-31 19:32:50',NULL),
	(53,2234,2,'退廃的で救いようのない生々しい描写は、元の「ジムノペディが終わらない」と変わらず。\r\n元と比べると表現する内容は同じにも関わらず、こちらの方がさらりと読めましたね。良い日本酒みたい。','2015-12-31 23:34:17','2015-12-31 23:34:17',NULL),
	(54,2235,24,'その真面目な性格ゆえ己の未熟さに不満を持ち、焦り、悩みを抱える魂魄妖夢の物語。\r\n理想とする師、魂魄妖忌の域に立つ事を追い求め、焦燥にかられる妖夢の姿に彼女の真面目(＝自分に厳しい)な性格がよく描写されていると思いました。\r\nそして、メインとなる具現化した自身の心の影との戦闘を通して、自分の弱さを受け入れられように強く成長していく様はこれもまた妖夢を魅力的に写しているのではないかと思います。\r\n','2016-01-04 00:23:00','2016-01-04 00:23:00',NULL),
	(55,2236,52,'「タッグ」合同の今回。主軸に二人のキャラクターが置かれることが念頭にあるからか、全体的にきれいにまとまっていて面白かったなあという印象。\r\n以下、各収録作品へ雑感。\r\n\r\n『If I Only Had A Heart　If I Only Had A Brain』Pumpkin\r\n思い悩むこころさん。そして彼女の中から消えはじめる、こいしとの記憶。\r\n明確には描写されなくても、確かにこいしがいたのだなあという書き方がうまい。\r\n\r\n『故にふたりの鳥獣伎楽』S.D.\r\n外から見た鳥獣伎楽の二人、そして二人思う鳥獣伎楽。\r\nバンドとして対外的には良いコンビである二人が、その胸中では精神的な凸凹コンビであることが物語として美しい構図で好き。それと普段の生活感がある感じも。あとは地味なところだけど冒頭でああいう組版やってくれるのも引き立って良いよね。\r\n\r\n『その鈴に捧ぐミステリオ』めるめるめるめ\r\nさとりの胸中。小鈴と阿求の挑戦。\r\n話の運び方が丁寧で、さとり相手に思考を詰めていく二人の考えに時折はっとさせられたり。手紙の回答には途中で気付いたのですが、小鈴の回答までは至らなかったので、そこが物語の面白さ（タッグたるゆえん）かなと。逆に言うと、手紙を開示するまで答えを明かさない方が、面白さがあったかも？\r\n回答を知った上で２週目読んでも面白いヨー。\r\n\r\n『キューミュロニムバスヘルレイザーズ--The Earth Lander.』白衣\r\n地底脱出作戦。\r\n名タッグだ！頭からケツまで全力だ！面白いぞ！以上！\r\nところで、読んでる最中黒ビキニをずっとブーメランパンツで想像してたけど、勇儀さん男じゃねぇってさっき気付いた。でもだって上半身は胸筋じゃん。\r\n\r\n『緋翼連理』こうず\r\n幻想郷的な妖怪退治。\r\n慧音かわゆい。慧音が迷惑かけるようで、妹紅もわりかしやっちゃってるのがお互いさまって感じの二人よな。\r\n\r\n『ガラス鉢中の幻想郷』百円玉\r\n阿求宅に押し掛け茨華仙。あと金魚。\r\n意外な取り合わせの二人。幻想的な話のつくりもさることながら、華扇ちゃんのキャラが良い。話が進むにつれて、阿求と自然に打ち解けてくる感じが「アリ」だなと思わせてくれる。\r\n\r\nところで、扉の題字フォントが不安定と思ったら、題字に二種のフォントを用いてタッグの二人を表現してるのか。どっちがどっちの文字形なのか想像してみるのも面白いのかも。','2016-01-10 14:36:31','2016-01-15 00:31:11',NULL),
	(56,2237,52,'ずるいのである。こりゃあ文句なしに面白い、ギャグ短編集ですぞ。\r\nなにがずるいって、まるでシーンを想像できないことのオンパレードなのに、つまるところなくスルスル読めてしまうところ。\r\n展開が飽きないのだ。加えて、想像できなくても理解はできる（？）文章のバランスが良い。くすくすと終始笑わせてくれる。\r\nある種うつくしさを感じるようなギャグ小説本だ。すごい。\r\n\r\n収録作は２つ。たぶん３つ――ボケるの早いし（目次）、あとがき読むまで気づかなかったよ！\r\n『あるガトーショコラ（後略）』表題作。\r\nあるガトーショコラより始まる、天使アリスと五目炒飯のヒューマンドラマ。\r\nショコラ裁判より始まり、ホムンクルス生成の儀式、幻想郷四大妖怪の復活、そして序盤の早苗の伏線がああいう形で回収されるとは…！\r\n転がり続ける展開が面白い、幻想郷社会の斜め上空に切り込んでいった快作。\r\n\r\n『シュレなんとかの猫なんとか』\r\nチョコバナナ砲より始まる、紅魔館の１億円の借金の顛末および１００匹に増えた黒猫の観測。\r\nショコラと違って、バナナは展開がみえてる。いかにして（シュレディンガーの猫箱をつかって）借金を返済するのか。\r\nただその見えてる道が全部だいなし！　さすが幻想郷！\r\n紅魔館の一同がかわいらしいのも相まって、楽しむのもあっという間。\r\n\r\n『あとがき』\r\nガトーショコラでは語られなかった、稗田印の砂糖の始まりについて。作者が綴ってくれてます。\r\nあとがきに描かれた挿絵の使い方がうますぎて、脱帽。こんなん笑うわー。\r\n\r\nちなみに、あるガトーショコラとシュレなんとかはウェブで初出のものが読めるみたい。\r\n作者様の作品を辿ると、みつかります。（https://twitter.com/namanie1）','2016-01-15 07:29:56','2016-01-15 07:29:56',NULL),
	(57,2239,52,'新書版２段組 構成６章、120ｐ。\r\n中学三年生、宇佐見菫子が『秘封倶楽部会長』を手にする話。\r\n\r\n現実的な〝優等生〟の殻を作り上げた菫子が、それをベロリと剥いで（決して破ってではなく）中から顔を覗かせたことで、菫子は『ヒフウクラブ』に捕らわれる。\r\n退屈な現実を紛らわす麻薬のように、蓮子とメリー、二人の秘封倶楽部の活動を覗き見る菫子が、現実と夢との対決の末に選び取った決意は痛々しいが、深秘録での彼女の今後を思えばその傷が心地良くもある。\r\nそして最後に、クルリ、とひっくり返ってしまう彼女の物語は、現実の強さを語る菫子をまるで夢が嘲笑うようだ。\r\n\r\nうへえ。面白い。\r\n高校生で秘封倶楽部を作る、宇佐見菫子ってどんな女？って考えるひとにおすすめ。\r\n\r\n超能力に自覚的で、良い頭と同じ程度の才能として超能力を扱う菫子の学生生活や、現代的なコンビニやらパソコンやらがアンニュイな彼女の生活を語ってる。なにより『秘封倶楽部』の活動を、動画で見るっていうのがいいよね。ベッドでヘッドフォンして、面白い動画を観て夜更かしする優等生の中学生って、なんかいいよね。伝われ。\r\n\r\nあと読了後ひとこと思ったのは、\r\nこの本、タイトルがすばらしい。','2016-01-29 08:49:10','2018-01-13 01:52:02',NULL),
	(58,2240,2,'序盤の蓮子がメリーのアレを当てたことの推理を喋る下りで完全にもうニタァって笑顔になりました。ごちそうさまです。','2016-08-13 21:28:44','2016-08-13 21:28:44',NULL),
	(59,2241,2,'2XXX年の近未来においてもスマホゲーが流行してるみたいで安心しました。蓮メリごちそうさまです。','2016-08-13 22:23:23','2016-08-13 22:23:23',NULL),
	(60,2242,24,'突如として御阿礼の子全員分の大量の記憶が押し寄せてこん睡状態になる阿求。\r\nそれを救うため永琳はさとりに阿求の記憶への潜航を依頼する。\r\nさとりが阿求の記憶世界で見たものは――\r\nとこの本は前後編だということで今回はいいところで終わりです。\r\n話の途中に差し込まれる歴代御阿礼の子の〝記憶〟に対する思いが事件の真相を予想させる材料になっていて、後半がどのように展開されるのか非常に楽しみです。いろいろ予想しながら後編を待つことにします。','2016-11-06 22:58:04','2016-11-06 22:58:04',NULL),
	(61,2244,2,'秘封倶楽部の短編モノ総収編。蓮子さんの優秀さあるいは天才性に焦点を当てた文章はとても好き。彼女は常に何を見て何を感じるのか想像が広がる。天才あるいは優秀さというパーソナリティをキャラに持たせると、ある種毒薬というか、作品自体を喰ってしまいがちなのだけれど、そうならず、テーマが別にあってそれで違和感がなく読めるのはスゴイし、そして贅沢な作品だなぁと思う。','2017-09-23 16:13:18','2017-09-23 16:16:58',NULL);
